'use strict';
function StallionModal (url, title){
    $('#stallion-modal-content').html('...... Loading Content Please Wait ........');
    $('#stallion-modal-title').html(title);
    $('#stallion-modal-content').load(url, function(){});
    $('#stallion-modal').modal('show');
}
